	add("bioethics", "{\"term\":\"bioethics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|ethics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of ethics that studies the implications of biological and biomedical advances\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Ronald M. Green, \u0027Jewish Teaching on the Sanctity and Quality of Life\u0027, Edmund D. Pellegrino, Alan I. Faden (editors), \u0027Jewish and Catholic Bioethics: An Ecumenical Dialogue\u0027, [http://books.google.com.au/books?id\u003drzIMeFZZuycC\u0026amp;pg\u003dPA33\u0026amp;dq\u003d%22bioethics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dChx2U8PTIcSkkQW02YHwBw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bioethics%22\u0026amp;f\u003dfalse page 33\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This graded appreciation of the developing moral status of human life, especially during its prenatal stages, is deeply relevant to some of the most important \u0027\u0027bioethics\u0027\u0027 debates of our day\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Florencia Luna, Arleen L. F. Salles, \u0027One: Latin American \u0027\u0027Bioethics\u0027\u0027: Some Reflections\u0027, Florencia Luna (editor), \u0027\u0027\u0027Bioethics\u0027\u0027 and Vulnerability: A Latin American View\u0027, [http://books.google.com.au/books?id\u003d8Ul863iX0xYC\u0026amp;pg\u003dPA9\u0026amp;dq\u003d%22bioethics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dChx2U8PTIcSkkQW02YHwBw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bioethics%22\u0026amp;f\u003dfalse page 9\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Bioethics\u0027\u0027 has been defined as the critical and systematic reflection on ethical issues in healthcare, biological and medical research, and public health.In the United States, the emergence of modern \u0027\u0027bioethics\u0027\u0027 has been characterized by a shift away from the religious and medical considerations that initially dominated the discourse to more philosophical and legal concepts\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Insoo Hyun, \u0027Bioethics and the Future of Stem Cell Research\u0027, [http://books.google.com.au/books?id\u003digZ-bK6y6QAC\u0026amp;pg\u003dPA14\u0026amp;dq\u003d%22bioethics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dChx2U8PTIcSkkQW02YHwBw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bioethics%22\u0026amp;f\u003dfalse page 14\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Despite the enormous breadth of \u0027\u0027bioethics\u0027\u0027, which ranges from interpersonal conflicts in medical practice, to ethical issues in animal and human subjects research, to policy formation in health care and the sciences, the \u0027\u0027bioethics\u0027\u0027 field may be united by two common characteristics\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"First, \u0027\u0027bioethics\u0027\u0027 is by nature a highly interdisciplinary activity.Secondly, \u0027\u0027biothics\u0027\u0027 tends to be practiced today along the main modalities of the ethics of modernity\", \"priority\":11}]}, \"synonyms\":{}}");

