	add("biomineralization", "{\"term\":\"biomineralization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|bio|mineralization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The formation of hard mineral deposits within a living organism; especially the process whereby bone and similar structural material is formed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Philip Ball, \u0027The Elements: A Very Short Introduction\u0027, Oxford 2004, p. 51\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This process of ‘\u0027\u0027biomineralization\u0027\u0027’ is used today to reclaim gold from the Youanmi deposits of Western Australia\", \"priority\":3}]}, \"synonyms\":{}}");

