	add("biomusic", "{\"term\":\"biomusic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|music|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of music based on the sounds of nature\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biomusical", "{\"term\":\"biomusical\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|musical|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A biographic musical\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bionanotechnology", "{\"term\":\"bionanotechnology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|nanotechnology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The biological application of nanotechnology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bionics", "{\"term\":\"bionics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|bio|electronics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The design of engineering systems, especially electronic ones, based on that of biological systems\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"biomimetics\", \"priority\":2}]}, \"synonyms\":{}}");

	add("biopetroleum", "{\"term\":\"biopetroleum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|bio|petroleum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any form of petroleum (or a similar substitute) made biologically (especially from algae\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biophilia", "{\"term\":\"biophilia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|bio|philia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hypochondria\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The biological drive to preserve oneself; love of life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"volume\u003d page\u003d passage\u003d \u0027\u0027Biophilia\u0027\u0027 (βίος, life; φιλία, love). The instinct of self-preservation common to man and the lower animals\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The love of or empathy with nature and all living things\", \"priority\":4}]}, \"synonyms\":{}}");

	add("biophotonics", "{\"term\":\"biophotonics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|photonics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the interaction of individual photons with biological structures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biophysics", "{\"term\":\"biophysics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|physics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The interdisciplinary science that applies theories and methods of the physical sciences to questions of biology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biopirate", "{\"term\":\"biopirate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|pirate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who engages in biopiracy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biopixel", "{\"term\":\"biopixel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|bio|pixel|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of an organized array of colonial bacteria\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioplast", "{\"term\":\"bioplast\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|bio|plast|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a mass or cell of bioplasm that is a unit of living matter; an independently existing mass of living matter\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioplastic", "{\"term\":\"bioplastic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|plastic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any form of synthetic polymer, similar to normal plastic, made from a renewable plant source rather than from petroleum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biopolitics", "{\"term\":\"biopolitics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|politics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The style of government that regulates populations through biopower\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anticapitalist insurrection using life and the body as weapons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The political application of bioethics\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A political spectrum that reflects positions towards the sociopolitical consequences of biotechnology\", \"priority\":4}]}, \"synonyms\":{}}");

