	add("bioprospecting", "{\"term\":\"bioprospecting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|prospecting|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The methodical search for novel pharmaceutical (and other) products from plants and microorganisms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioprosthesis", "{\"term\":\"bioprosthesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|prosthesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prosthesis made from biological, rather than synthetic, material\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biopsychology", "{\"term\":\"biopsychology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|psychology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"biological psychology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biopyribole", "{\"term\":\"biopyribole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|pyribole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the rock-forming minerals pyroxene, amphibole, and mica\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioreaction", "{\"term\":\"bioreaction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|reaction|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A biological reaction\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioreactor", "{\"term\":\"bioreactor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|reactor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fermentation vat, containing microorganisms or biochemically active substances, used for waste recycling or for making drugs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biorefinery", "{\"term\":\"biorefinery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|refinery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the coproduction of a range of biologically-based products (food, feed, materials, chemicals) and energy (fuels, power, heat) from biomas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a facility that carries out such production\", \"priority\":2}]}, \"synonyms\":{}}");

	add("bioremediation", "{\"term\":\"bioremediation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|remediation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of biological organisms, usually microorganisms, to remove contaminants, especially from polluted water\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biorepository", "{\"term\":\"biorepository\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|repository|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a long-term storage and conservation facility for biological specimens\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioresource", "{\"term\":\"bioresource\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|resource|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any resource of biological origin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biorhythm", "{\"term\":\"biorhythm\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First coined 1960, from {{prefix|bio|rhythm|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any cyclic biological or physiological pattern or activit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of three sinusoidal graphs, normally plotted by computer, having a person\u0027s birthdate as origin, that that are supposed to give meaningful information about emotional levels, physical energy levels, and mental/psychic sensitivity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("biosafety", "{\"term\":\"biosafety\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|safety|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"protection from potential harm from biological agents, such as infectious microbes or modified genes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biosatellite", "{\"term\":\"biosatellite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|satellite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an artificial satellite that is designed to carry humans or other organisms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biosemiotics", "{\"term\":\"biosemiotics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|semiotics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A growing field that studies the production, action and interpretation of signs in the biological realm\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biosensing", "{\"term\":\"biosensing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|sensing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of nanoscale or microscale biological sensors\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biosequestration", "{\"term\":\"biosequestration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|sequestration|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"storage and removal of carbon from the atmosphere by conversion of carbon dioxide into biomass, generally by photosynthetic plants or bacteri\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Increased plant growth resulted in greater \u0027\u0027biosequestration\u0027\u0027 than predicted\", \"priority\":2}]}, \"synonyms\":{}}");

	add("bioseston", "{\"term\":\"bioseston\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|seston|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The living particulate matter suspended in bodies of water such as lakes and seas\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biosphere", "{\"term\":\"biosphere\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|bio|sphere|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the part of the Earth and its atmosphere capable of supporting lif\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the totality of living organisms and their environment\", \"priority\":2}]}, \"synonyms\":{}}");

	add("biostitute", "{\"term\":\"biostitute\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|biology|prostitute|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A biologist who lies for money\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biostratinomy", "{\"term\":\"biostratinomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|bio|gloss1\u003dlife|strati|gloss2\u003dlayer|nomy|gloss3\u003dlaw|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the processes that take place following the death of an organism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biostructure", "{\"term\":\"biostructure\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|structure|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"biological structure\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biosurgery", "{\"term\":\"biosurgery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|surgery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The medicinal use of maggots to clean wounds and promote healing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biosystematics", "{\"term\":\"biosystematics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|systematics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"taxonomy based upon statistical data of the evolution of organisms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biota", "{\"term\":\"biota\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) ultimately from \u0027βίος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The living organisms of a region\", \"priority\":1}]}, \"synonyms\":{}}");

	add("biotech", "{\"term\":\"biotech\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Biotechnolog\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m planning to work in \u0027\u0027biotech\u0027\u0027 after college\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A company specializing in biotechnology, or stock in such a compan\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A lot of people invested in \u0027\u0027biotechs\u0027\u0027, back in the \u002790s\", \"priority\":4}]}, \"synonyms\":{}}");

	add("biotechnology", "{\"term\":\"biotechnology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|technology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of living organisms (especially microorganisms) in industrial, agricultural, medical and other technological applications\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, New Zealand Department of Trade and Industry, \u0027Biotechnology in New Zealand—A Business Perspective\u0027, [http://books.google.com.au/books?id\u003d2Y-2AAAAIAAJ\u0026amp;q\u003d%22biotechnology%22%7C%22biotechnologies%22\u0026amp;dq\u003d%22biotechnology%22%7C%22biotechnologies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFGJ0U7CqB4TQkgX6tYGwDQ\u0026amp;redir_esc\u003dy page 8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Japan\u0027s strength lies in more traditional \u0027\u0027biotechnology\u0027\u0027 such as fermentation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mabju Sharma, Renu Swarup, \u0027The Way Ahead - The New Technology in an Old Society\u0027, T. K. Ghose, P. Ghosh (editors), \u0027Biotechnology in India I\u0027, [http://books.google.com.au/books?id\u003d77z8YXG4oLEC\u0026amp;pg\u003dPA5\u0026amp;dq\u003d%22biotechnology%22%7C%22biotechnologies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dt010U6vTNMyJlQX66IBg\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22biotechnology%22%7C%22biotechnologies%22\u0026amp;f\u003dfalse page 5\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The developments in \u0027\u0027biotechnology\u0027\u0027, particularly with the basic understanding of genetics, immunology, biochemistry, biochemical engineering and molecular biology, have paved the way for major \u0027\u0027biotechnology\u0027\u0027 products and processes and have provided tools to the manufacturing and service industry\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Sean D. Sutton, \u0027Introduction\u0027, Sean D. Sutton (editor), \u0027Biotechnology: Our Future as Human Beings and Citizens\u0027, [http://books.google.com.au/books?id\u003d8Nkbijtdov0C\u0026amp;pg\u003dPA6\u0026amp;dq\u003d%22biotechnology%22%7C%22biotechnologies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmEp0U8DBJcPukQX5iYDABQ\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22biotechnology%22%7C%22biotechnologies%22\u0026amp;f\u003dfalse page 6\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Moreover, Arnhart points out that both the proponents and critics of \u0027\u0027biotechnology\u0027\u0027 are compelled to appeal to our natural moral sense\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The application of the principles and practices of engineering and technology to the life sciences\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Charles Spillane, Yvonne Pinto, \u00271: Biosafety in Agrcultural \u0027\u0027Biotechnology\u0027\u0027: Balancing Social and Environmental Impacts\u0027, Timothy M. Swanson (editor), \u0027The Economics of Managing \u0027\u0027Biotechnologies\u0027\u0027\u0027, [http://books.google.com.au/books?id\u003dDLdyS5qBzWsC\u0026amp;pg\u003dPA4\u0026amp;dq\u003d%22biotechnologies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dv1d0U7iYNc_XkQXY4YDQCw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22biotechnologies%22\u0026amp;f\u003dfalse page 4\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Agricultural \u0027\u0027biotechnology\u0027\u0027 comprises a collection of scientific techniques, including genetic engineering, that are used to modify and improve plants, animals and microorganisms for human profit. Agricultural \u0027\u0027biotechnologies\u0027\u0027 are not a substitute for conventional plant and animal breeding, but can be a powerful complement to improving the efficiency and sustainability of agricultural production\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Yutaka Tanaka, \u0027Attitude toward Bioethics and Acceptance of \u0027\u0027Biotechnology\u0027\u0027\u0027, William G. Flynne (editor), \u0027\u0027\u0027Biotechnology\u0027\u0027 and Bioengineering\u0027, [http://books.google.com.au/books?id\u003dWEBBP5IYqJQC\u0026amp;pg\u003dPA175\u0026amp;dq\u003d%22biotechnologies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dv1d0U7iYNc_XkQXY4YDQCw\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22biotechnologies%22\u0026amp;f\u003dfalse page 175\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The result of study 3 suggests that the factor of bioethics is important not only for the acceptance of \u0027\u0027biotechnologies\u0027\u0027 themselves, such as gene recombination technology and clone technology, but also the acceptance of foods and products which are produced by the use of \u0027\u0027biotechnologies\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Wendy Harcourt, \u0027Chapter 1: Heading Blithely Down the Garden Path?: Some Entry Points into Current Debates on Women and \u0027\u0027Biotechnologies\u0027\u0027\u0027, Francesca Molfino, Flavia Zucco (editors), \u0027Women in \u0027\u0027Biotechnology\u0027\u0027: Creating Interfaces\u0027, [http://books.google.com.au/books?id\u003dIfrwboq8fBEC\u0026amp;pg\u003dPA38\u0026amp;dq\u003d%22biotechnologies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dv1d0U7iYNc_XkQXY4YDQCw\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22biotechnologies%22\u0026amp;f\u003dfalse page 38\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"It therefore follows that we need to ensure that the conception, development, dissemination and application of \u0027\u0027biotechnologies\u0027\u0027 are held to ethical democratic standars which ensure gender equality\", \"priority\":19}]}, \"synonyms\":{}}");

	add("bioterror", "{\"term\":\"bioterror\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"bio- + terror\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Activity designed to induce terror using biological techniques\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioterrorism", "{\"term\":\"bioterrorism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|bio|terrorism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Terrorism that involves biological weapons or agents\", \"priority\":1}]}, \"synonyms\":{}}");

	add("bioterrorist", "{\"term\":\"bioterrorist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a terrorist employing biological weapons\", \"priority\":1}]}, \"synonyms\":{}}");

